import { TileLayer as LeafletTileLayer } from 'leaflet';
export const TileLayer = createTileLayerComponent(function createTileLayer({
  url,
  ...options
}, context) {
  return {
    instance: new LeafletTileLayer(url, withPane(options, context)),
    context
  };
}, updateGridLayer);
